  "learn React",
  "eat",
  "sleep",
  "practice React",
  "watch React Pluralsight videos",
  "practice JavaScript",
]

function App() {
  return (
    <div>
      Hello React
      <ToDoApp 
        name="Tim" 
        currentCity={weatherData.currentCity} 
        description={weatherData.description}
        temperature={weatherData.temperature}
        newProp='whatever'
      /> 
    </div>
  );
}

export default App;
